import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import api from '../../services/api';

export default function NovoDono() {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    nome: '', cpf: '', endereco: '', telefone: '', dataNascimento: '', observacoes: ''
  });
  const [errors, setErrors] = useState({});

  const handleSubmit = async e => {
    e.preventDefault();
    try {
      await api.post('/donos', form);
      navigate('/donos');
    } catch (err) {
      const resp = err.response?.data;
      if (resp?.erros) {
        const fieldErrors = resp.erros.reduce(
          (acc, cur) => ({ ...acc, [cur.path]: cur.msg }), {}
        );
        setErrors(fieldErrors);
      } else {
        setErrors({ form: resp?.erro || 'Erro ao cadastrar dono' });
      }
    }
  };

  return (
    <div className="container my-5">
      <div className="p-4 border rounded shadow-sm bg-white">
        <div className="d-flex justify-content-between align-items-center mb-4">
          <h2>Cadastrar Novo Dono</h2>
          <div>
            <Link to="/" className="btn btn-secondary me-2">← Voltar ao Início</Link>
            <Link to="/donos" className="btn btn-dark">Ver Donos</Link>
          </div>
        </div>

        {errors.form && <div className="alert alert-danger">{errors.form}</div>}

        <form onSubmit={handleSubmit}>
          <div className="mb-3">
            <label className="form-label">Nome:</label>
            <input
              name="nome"
              className="form-control"
              value={form.nome}
              onChange={(e) => {
                const somenteLetras = e.target.value.replace(/[^A-Za-zÀ-ÿ\s]/g, '');
                setForm(f => ({ ...f, nome: somenteLetras }));
                setErrors(errs => ({ ...errs, nome: null }));
              }}
            />
            {errors.nome && <div className="text-danger">{errors.nome}</div>}
          </div>

          <div className="mb-3">
            <label className="form-label">CPF:</label>
            <input
              type="text"
              name="cpf"
              className="form-control"
              value={form.cpf}
              onChange={(e) => {
                let value = e.target.value.replace(/\D/g, '');
                value = value.slice(0, 11);
                value = value.replace(/(\d{3})(\d)/, '$1.$2');
                value = value.replace(/(\d{3})(\d)/, '$1.$2');
                value = value.replace(/(\d{3})(\d{1,2})$/, '$1-$2');
                setForm({ ...form, cpf: value });
                setErrors({ ...errors, cpf: null });
              }}
            />
            {errors.cpf && <div className="text-danger">{errors.cpf}</div>}
          </div>

          <div className="mb-3">
            <label className="form-label">Endereço:</label>
            <input
              name="endereco"
              className="form-control"
              value={form.endereco}
              onChange={(e) => setForm(f => ({ ...f, endereco: e.target.value }))}
            />
            {errors.endereco && <div className="text-danger">{errors.endereco}</div>}
          </div>

          <div className="mb-3">
            <label className="form-label">Telefone:</label>
            <input
              name="telefone"
              className="form-control"
              value={form.telefone}
              onChange={(e) => {
                let tel = e.target.value.replace(/\D/g, '').slice(0, 11);
                setForm(f => ({ ...f, telefone: tel }));
                setErrors(errs => ({ ...errs, telefone: null }));
              }}
            />
            {errors.telefone && <div className="text-danger">{errors.telefone}</div>}
          </div>

          <div className="mb-3">
            <label className="form-label">Data de Nascimento:</label>
            <input
              type="date"
              name="dataNascimento"
              className="form-control"
              value={form.dataNascimento}
              onChange={(e) => setForm(f => ({ ...f, dataNascimento: e.target.value }))}
            />
            {errors.dataNascimento && <div className="text-danger">{errors.dataNascimento}</div>}
          </div>

          <div className="mb-3">
            <label className="form-label">Observações:</label>
            <textarea
              name="observacoes"
              className="form-control"
              rows="3"
              value={form.observacoes}
              onChange={(e) => setForm(f => ({ ...f, observacoes: e.target.value }))}
            />
          </div>

          <button type="submit" className="btn btn-success">Cadastrar Dono</button>
        </form>
      </div>
    </div>
  );
}
